import ModalApp from "../landing/video/Video";
import { useState } from "react";
import { BrowserRouter, Route, Link } from "react-router-dom";

const Main = () => {
  const [mostrar, setMostrar] = useState(false);
  function mostrarVideo() {
    setMostrar(true);
  }

  return (
    <div className="jumbotron">
      <div className="caja">
        <h1 id="h1">KALYPSE</h1>
        <h2>Createur de combinaisons de plong√©e personnalisables</h2>
        <hr />
        <h3>MADE IN FRANCE</h3>
        <div className="cont_video">
          <button onClick={mostrarVideo} className="video">
            <Link to="./video/ModalApp.js">VIDEO</Link>
          </button>
        </div>
      </div>
      {mostrar ? (
        <BrowserRouter>
          <Route path="/ModalApp.js">
            <ModalApp />
          </Route>
        </BrowserRouter>
      ) : null}
    </div>
  );
};

export default Main;
